/** 
 * Constructs a new  {@code LineReader} with the specified capacity and charset.
 * @param in the {@code InputStream} to read data from.
 * @param capacity the capacity of the buffer.
 * @param charset the charset used to decode data. Only US-ASCII, UTF-8 and ISO-8859-1 aresupported.
 * @throws NullPointerException if {@code in} or {@code charset} is null.
 * @throws IllegalArgumentException if {@code capacity} is negative or zeroor the specified charset is not supported.
 */
public StrictLineReader(InputStream in,int capacity,Charset charset){
  if (in == null || charset == null) {
    throw new NullPointerException();
  }
  if (capacity < 0) {
    throw new IllegalArgumentException("capacity <= 0");
  }
  if (!(charset.equals(Util.US_ASCII))) {
    throw new IllegalArgumentException("Unsupported encoding");
  }
  this.in=in;
  this.charset=charset;
  buf=new byte[capacity];
}
